class ExA extends RuntimeException {  ExA(String s) {    super(s);  }}class ExB extends RuntimeException {  ExB(String s) {    super(s);  }}public class throw_03_tryCF_tryC {  public static void main(String[] args) {    try {      try {        if (true) throw new ExA("ex");        System.out.println("unreachable");      } catch(ExB e) {        System.out.println("caught ExB: " + e.toString());      } finally {        System.out.println("finally");      }      System.out.println("unreachable");    } catch (ExA e) {      System.out.println("caught ExA: " + e.toString());    }    System.out.println("Done!");  }}